import axios from 'axios';
import { Bar, BarChart, CartesianGrid, ComposedChart, Legend, Line, LineChart, Scatter, ScatterChart, Tooltip, XAxis, YAxis } from 'recharts';
const data = [
  { 군구: '광진구', 유동인구수: 32760, 비유동인구수: 34000 },
  { 군구: '동대문구', 유동인구수: 30480, 비유동인구수: 56000 },
  { 군구: '마포구', 유동인구수: 27250, 비유동인구수: 23000 },
  { 군구: '구로구', 유동인구수: 49870, 비유동인구수: 67000 },
  { 군구: '강남구', 유동인구수: 51420, 비유동인구수: 55000 },
];
class Test extends src {
  constructor(props){
    super(props)
    this.state={
      append_FPList:undefined
    }
  }
  f1 = ()=>{
    axios.get('http://3.35.120.155:5000/users',{})
    .then((res)=>{
      console.log(res.data.entry);
      this.setState({append_FPList:res.data.entry})
      })
  }
  render() {
    return (
      <div>
        <h1>App</h1>
        <button onClick={this.f1}>버튼</button>
        <ScatterChart
        width={1000}
        height={300}
        margin={{top:5, right:30, left:20, bottom:5}}
        >
        <CartesianGrid strokeDasharray="4 3"/>
        <XAxis type="number" dataKey="연령대(10세단위)" name="연령대" unit="세"/>
        <YAxis type="number" dataKey="유동인구수" name="유동인구수" unit="명"/>
        <Tooltip cursor={{strokeDasharray: '3 3'}}/>
        <Scatter data={this.state.append_FPList} fill="#003458"/>
        </ScatterChart>
      </div>
    );
  }
}
export default Test;
